    "2016-06-01T01:07:29.311666",nt"name": "u-s-forest-service-national-wild-and-scenic-river-segments",nt"isopen":
    true,nt"url": null,nt"notes": "A map service on the www that depicts the
    river corridors of each Wild and Scenic River designated by Congress or the Secretary
    of the Interior for the United States and Puerto Rico. This GIS data layer was created
    from a mulit-agency effort by the US Forest Service, National Park Service, Bureau
    of Land Managment, and the US Fish and Wildlife Servce. The spatial data were referenced
    to the latest High Resolution National Hydrological Data Layer (NHD 1:24,000 Scale
    or better), published by United States Geological Survey (USGS).There are currently
    208 Wild and Scenic Rivers in 39 States and the Commonwealth of Puerto Rico, totalling
    12,708.8 miles. This is a little more than one-quarter of one percent of the nation's
    rivers.",nt"license_title": "Creative Commons CCZero",nt"extras": [{ntt"key":
